import React from 'react';
import './App.css';
import jsPDF from 'jspdf';
import ipfs from './ipfs';
import web3 from './web3';
import storehash from './storehash'
class App extends React.Component
{
  constructor()
  {
    super();
    this.state = {
      name:"Raj",
      age:"21",
      ipfsHash:null,
      buffer:'',
      ethAddress:'',
      blockNumber:'',
      transactionHash:'',
      gasUsed:'',
      txReceipt: '' 
    }
  }

  captureFile =(event) => {
    event.stopPropagation()
    event.preventDefault()
    const file = event.target.files[0]
    let reader = new window.FileReader()
    reader.readAsArrayBuffer(file)
    reader.onloadend = () => this.convertToBuffer(reader)    
  };

  convertToBuffer = async(reader) => {
    //file is converted to a buffer for upload to IPFS
      const buffer = await Buffer.from(reader.result);
    //set this buffer -using es6 syntax
      this.setState({buffer});
  };


  downloadpdf = ()=> {
      var doc = new jsPDF('p','pt');
      var imageData = 'data:image/jpeg;base64,';
      doc.addImage(imageData,'JPEG',0,0,500,580);
      doc.setFont('courier');
      doc.setFontType('normal');
      doc.text(150,100,this.state.name);
      doc.save('new.pdf');
  }


  onSubmit = async (event) => {
    event.preventDefault();
    const accounts = await web3.eth.getAccounts();
     
    const ethAddress= await storehash.options.address;
    this.setState({ethAddress});

      const result = await ipfs.add(this.state.buffer);
      console.log(result[0].hash);

      // this.setState({ipfsHash:result[0].hash});
     await ipfs.add(this.state.buffer, (err, ipfsHash) => {
      console.log(err,ipfsHash);

      //setState by setting ipfsHash to ipfsHash[0].hash 
      this.setState({ ipfsHash:ipfsHash[0].hash });
 
      storehash.methods.sendHash(this.state.ipfsHash).send({
        from: accounts[0] 
      }, (error, transactionHash) => {
        console.log(transactionHash);
        this.setState({transactionHash});
      });  
    }) 
    console.log("reached here after completing transaction with ipfs infura");
    const storedHash = await storehash.methods.getHash().call({from:accounts[0]});
    console.log("after inserting ipfs hash to the local blockchain");
    console.log(storedHash);
  };  




  render(){

    return(
      <div> 
         <button onClick={this.downloadpdf}> Click me to download pdf</button>
         <a target='blank' href={`https://ipfs.io/ipfs/${this.state.ipfsHash}`}> Hey your pdf is here</a>
         <form onSubmit={this.onSubmit}>
            <input 
              type = "file"
              onChange = {this.captureFile}
            />
             <button 
             bsStyle="primary" 
             type="submit"> 
             Send it 
             </button>
          </form>
      </div>
    );
  }
}
export default App;
